import React, { useEffect, useState } from 'react'
import { Descriptions } from 'antd'
import {Collapse, Divider, Row, Col} from "antd"
const { Panel } = Collapse;

const Purches = () => {
    const [purches, setPurches] = useState([])
    useEffect(() => {
    const getPurch = async () => {
    const requestOptions = {
    method: "GET"
    }
    return await fetch("/api/Client", requestOptions)
    
    .then(response => response.json())
    .then(
    (data) => {
    console.log('Data:', data)
    setPurches(data)
    },
    (error) => {
    console.log(error)
    }
    )
    }
    getPurch()
    }, [setPurches])
 
    return (
        <React.Fragment>
         <label style={{fontFamily:"Cinzel",textAlign: 'center',color:'white', fontWeight: 'lighter', fontSize: '20px', marginTop: '10px', color: 'var(--blue)', display: 'block' }}>Clients: </label>
         
        <div style={{ flexWrap: 'wrap' }}>
        {purches.map(({ id, fullName, driverLicense, pasport, date, price, accessName, modelName}) => (   
        <div key={id} id={id}>
            <p> </p>
                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 , marginTop: "50px"}}>ФИО: <p style={{fontSize:20}}> {fullName} </p>  </label>

                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 }}>ВУ:<p style={{fontSize:20}}> {driverLicense}</p> </label>

                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 }}>Паспорт: <p style={{fontSize:20}}> {pasport}</p> </label> 

                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 }}>Дата покупки: <p style={{fontSize:20}}> {date} </p> </label>

                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 }}>Конечная стоимость: <p style={{fontSize:20}}> {price+100000} </p> </label>

                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 }}>Название доп. комплектующих: <p style={{fontSize:20}}> {accessName}</p> </label>

                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 18 }}>Комплектация: <p style={{fontSize:20}}> {modelName} </p> </label>

                 {/* <p>   <Descriptions.Item>
                    <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 28 }}>ФИО: <p style={{fontSize:20}}> {fullName} </p>  </label>
                    </Descriptions.Item> </p>
               
                <p> <Descriptions.Item>
                    <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 28 }}>ВУ:<p style={{fontSize:20}}> {driverLicense}</p> </label> 
                    </Descriptions.Item> </p>
                    

                    <Descriptions.Item>
                   <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 20 }}>Паспорт: <p style={{fontSize:20}}> {pasport}</p> </label> 
                    </Descriptions.Item>

                    <Descriptions.Item >
                   <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 20 }}>Дата покупки: <p style={{fontSize:20}}> {date} </p> </label>
                    </Descriptions.Item>

                    <Descriptions.Item>
                    <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 20 }}>Конечная стоимость: <p style={{fontSize:20}}> {price+100000} </p> </label>
                    </Descriptions.Item>

                    <Descriptions.Item>
                   <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 20 }}>Название доп. комплектующих: <p style={{fontSize:20}}> {accessName}</p> </label>
                    </Descriptions.Item>

                    <Descriptions.Item>
                  <label style={{ color: "var(--blue)", fontFamily:"Cinzela", fontSize: 20 }}>Комплектация: <p style={{fontSize:20}}> {modelName} </p> </label>
                    </Descriptions.Item>

                 </div>
                    
                    
                    </Descriptions> */}
               
                
        {/* <img src={require("../../Images/" +"acc"+ id + ".png")} style={{ width: '80%', height: '200px' }} />
        <div style={{ fontFamily:"Cinzel", marginLeft:'130px', fontWeight: 'lighter', fontSize: '20px', marginTop: '10px', color: 'var(--blue)' }}>{name}</div> */}
        </div>
        ))}
        </div>
        

       
        </React.Fragment>
        )
        }
        export default Purches
